import React from "react";
import classes from './Users.module.scss'

const Users = props => {
  return (
    <div>
      {props.users.map(u => (
        <li key={u.id}>
          <div>
            <div>
              <div>
                <img src={u.photoUrl} alt="" />
              </div>
              <div>
                <button>follow</button>
              </div>
            </div>
            <div>
              <div>
                <div>{u.fullName}</div>
                <div>{u.status}</div>
              </div>
              <div>
                <div>{u.location.country}</div>
                <div>{u.location.city}</div>
              </div>
            </div>
          </div>
        </li>
      ))}
    </div>
  );
};

export default Users;
